    public static int[] bubbleSort(int[] arr) {
       /* 1.遍历两两计较
        第一次:i 最后length-1和length-2比较
        第二次:  length-2和length-3比较
        ...
        最后
        */
        int k;
        for (int j = arr.length; j > 0; j--) {
            for (int i = 0; i < j - 1; i++) {
                if (arr[i] > arr[i + 1]) {
                    k = arr[i];
                    arr[i] = arr[i + 1];
                    arr[i + 1] = k;
                }
            }
        }
        return arr;
    }
